CREATE DEFINER=`root`@`%` FUNCTION `calc_overtime`(
	`gapok` INT,
	`hours` INT,
	`holiday` BIT
) RETURNS decimal(10,0)
BEGIN
  declare multiplier decimal(10, 3);
  declare total int;
  declare base decimal(20, 3);
  declare hourss int;
   
  set total = 0;
  set base = gapok / 173;
  set hourss = hours % 8;
  
  if holiday = 0 then
  	if hours = 1 then
  		set total = 1.5 * base;
  	elseif hours > 1 then
  	  	set total = hours * base;
  	end if;  
  	
  else  
    if hours < 8 then
       set total = hours * 2 * 1 / 173 * gapok;
    elseif hours = 8 then
       set total = 7 * 2 * 1 / 173 * gapok + 1 * 3 * 1 / 173 * gapok;
    else
    	 set total = 7 * 2 * 1 / 173 * gapok + 1 * 3 * 1 / 173 * gapok + hourss * 4 * 1 / 173 * gapok;
    end if;
  end if;  
  
return total;  
END$$

